window.bookSummaryJSON = "<p>Fate stripped everything from me, forcing me to face my worst nightmare.</p> <p>As the adopted and weakest member of my pack, I’ve always been an outcast and mistreated, especially since I've never been able to shift into my animal form. </p> <p>Every time I try to find a way to escape my personal hell, my pack leader stops me, vowing that I'll never be free from him. </p> <p>Then, the worst happens.</p> <p>A group of my pack members attack me. </p> <p>Alone, outnumbered, and stuck in my human form, I'll fight for my life even though there’s no hope for survival. </p> <p>Until a group of unfamiliar wolves come to my aid.</p> <p>The sexiest and strongest of them, Bodey, is adamant to protect me. </p> <p>And something inside me tugs toward him almost unnaturally. </p> <p>But it turns out things aren't what they seem. </p> <p>There might be something more to my past than I knew, and Bodey might be the very person I need protecting from.</p> <p>Get this steamy and suspenseful forced-proximity, \"touch her and unalive\", broody-male, fated-mates, royal wolf-shifter romance today!</p>"; 
